import React from 'react'
import './feature.css'

const Feature = () => {
  return (
    <div className="gpt3_features section__paddding" id="features">
      <div className="gpt3__features_heading">
        <h1 className="gradient_text"> </h1>
      </div>
    </div>
  )
}

export default Feature
